import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom'; // Make sure you have react-router-dom installed

const StudentForm = () => {
  const [name, setName] = useState('');
  const [grade, setGrade] = useState('');
  const [age, setAge] = useState('');
  const navigate = useNavigate(); // Initialize navigate hook for redirection

  const handleSubmit = (e) => {
    e.preventDefault();

    fetch('http://localhost:5000/api/insert-student', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ name, age, grade }),
    })
      .then((response) => response.json())
      .then((data) => {
        if (data.redirectUrl) {
          alert(data.message);
          navigate(data.redirectUrl); // Redirect to the URL provided by the server
        } else {
          alert('Unexpected response from the server.');
        }
      })
      .catch((error) => console.error('Error inserting data:', error));
  };

  return (
    <div>
      <h1>Student Form</h1>
      <form onSubmit={handleSubmit}>
        <div>
          <label>Name:</label>
          <input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Grade:</label>
          <input
            type="text"
            value={grade}
            onChange={(e) => setGrade(e.target.value)}
            required
          />
        </div>
        <div>
          <label>Age:</label>
          <input
            type="number"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            required
          />
        </div>
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};

export default StudentForm;
